import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';

class If_Else extends Component{
    constructor(){
        super()
        this.state={
            login: true
        }
    }                                   // variable Element    
    render(){
        return(
            this.state.login? <h2>I am first.</h2> : <h2>I am Segand.</h2>
      );
}
}
export default If_Else;

